import { useState, useEffect } from "react";

function About() {
	const data = [
		{
			imgUrl: "",
			review: "",
			name: "",
		},
		{
			imgUrl: "",
			review: "",
			name: "",
		},
		{
			imgUrl: "",
			review: "",
			name: "",
		},
	];
	return (
		<div id='about_main_container'>
			<div id='review_main_container'>
				<div id='review_title_container'></div>
				<div id='review_body_container'>
					{data.map((element, index) => {
						return (
							<>
								<div id='review_img_container'>
									<img src={element.imgUrl} />
								</div>
								<div id='review_text_container'>
									<div id='review'>{element.review}</div>
									<div id='reviewer_name'>{element.name}</div>
								</div>
							</>
						);
					})}
				</div>
			</div>
		</div>
	);
}

export default About;
